import logo from './logo.svg';
import './App.css';
import Menu from './menu';
import Footer from './Footer';
function App() {
  return (
    <div className="App">
      <div className="header-menu-container">
        <Menu/>
      </div>
      <div className='introduction'>
        <h1>I'm Anantha Ramu</h1>
        <h6>Frontend developer,Python engineer and Android developer and playing game and listening the music for relax.</h6>
        <h6>Working with my hands to make magic happen on the internet . View my projects , Resume , Contact or send me an email ramuanantha6299@gmail.com.</h6>
      </div>
      <div className='#About'>
          <h1>About Me</h1>
          <p>I am a passionate software developer, with a strong background in Python and a keen interest in frontend development. I am currently working remotely, focusing primarily on Python-related projects and freelance work. I have a deep love for music and enjoy playing various genres, especially rock and pop.</p>
      </div>
      <div className='footerdive'>
      <Footer/>
      </div>
    </div>
  );
}

export default App;
